import React, { Component } from "react";
import TopNavBar from "../TopNavbar/TopNavbar";
import BottomNavBar from "../BottomNavbar/BottomNavbar";
import ReactPlayer from "react-player"
import YouTube from 'react-youtube';
import './Events.css';

export default class Events extends Component {
    onReady=(event)=>{
        event.target.pauseVideo();
    }
  render() {
    const opts = {
        height: '600',
        width: '640',
        playerVars: {
          // https://developers.google.com/youtube/player_parameters
          autoplay: 1,
        },
      };
    return (
      <div>
          <div>
              <TopNavBar/>

              </div>
        <div className="container-div">
            <div>
            <img  className="events-img" src="https://images.squarespace-cdn.com/content/v1/57f0499ed1758e2d78db7dbe/1597185587335-0LOUC7CLJ8M2MI6WBWIS/ke17ZwdGBToddI8pDm48kJ-cG44mKTTx6u25qmD3cW4UqsxRUqqbr1mOJYKfIPR7LoDQ9mXPOjoJoqy81S2I8N_N4V1vUb5AoIIIbLZhVYxCRW4BPu10St3TBAUQYVKcHzilmmQLvpCrAdjn_H4tTLd1XS1UYyrXPU2zirkysjw2VbDr5zwm151NZn9gDqe9/newHeader.png?format=1500w"></img>
            </div>
            </div>
            <div className="container-div">
            <YouTube videoId="eRXU1n_S7RI" opts={opts} onReady={this._onReady} />
    </div>

        <div>
            <BottomNavBar/>
        </div>
      </div>
    );
  }
}
